import React, { Component } from 'react'
import {Link} from 'react-router-dom';

import socket from '../components/SocketUser';
import Table from '../components/Table'

import NavigationBar from '../../components/NavigationBar'


class Students extends Component {

  constructor(props){
    super(props);

  }

  render() {

  	if(this.props.page == 'Students'){
	    return (
	    	<div>
		        <NavigationBar loggedIn = {this.state.loggedIn} onSignOut = {this.props.onSignOut} navbarItems = {[[this.toLogin, "Home"], [this.toStaff, "Staff"], [this.toPartners, "Partners"], [this.toStudents, "Students"]]}/>



				<h1> STUDENT STUFF ARJHSD </h1>
		    </div>
	    	)
		}
    else {
    	return null
    }

  	}

}






export default Students;
